How do I convert a time string (e.g. "8:02 AM") to a sortable field<p>My MongoDB database includes times as strings right now, and I'd like to be able to filter queries between certain times. </p>

<p>For example, time fields in my database look like "8:02 AM"" and "10:20 PM", and I want to be able to filter my results by only those between "8:00 AM" and "9:00 AM". My thinking is to convert every string into a number that is the minute of the day, so for example, "9:00 AM" becomes 540 and "10:20 PM" becomes 1,340, but there has to be a more efficient way to do this. Is there anything obvious I'm missing? </p>

<p>I also tried the JavaScript <code>Date()</code> but that assumed I was EST and converted the time to GMT which I don't want at all. </p>

<p>Some janky code that seems to work, but I'm certain there's a better way:</p>

<pre><code>const time_function = (time) =&gt; {
    const split_string = time.replace(" ",":").split(":")
    if(split_string[0]==="12" &amp;&amp; split_string[2]==="AM"){
        split_string[0] = "0"
        split_string.push(0)
    } else if(split_string[0]==="12" &amp;&amp; split_string[2]==="PM"){
        split_string.push(0)
    } else if(split_string[2]=="PM"){
        split_string.push(720)
    } else if (split_string[2]==="AM"){
    split_string.push(0)
    }
    const minutes = (parseInt(split_string[0])*60)+parseInt(split_string[1])+split_string[3]
    return minutes
}
</code></pre>

